import { Component } from '@angular/core';
import { LeafletModule } from '@asymmetrik/ngx-leaflet';
import {
  icon,
  latLng,
  Marker,
  tileLayer,
  Map,
  LeafletMouseEvent,
} from 'leaflet';
import { ButtonComponent } from '@/app/presenter/views/shared/components/design-system/atoms/button/button.component';
import { Button } from 'primeng/button';
import { DynamicDialogRef } from 'primeng/dynamicdialog';
import { IconComponent } from '@/app/presenter/views/shared/components/design-system/atoms/icon/icon.component';

@Component({
  selector: 'app-map-modal',
  standalone: true,
  imports: [LeafletModule, ButtonComponent, Button, IconComponent],
  templateUrl: './map-modal.component.html',
  styleUrl: './map-modal.component.scss',
})
export class MapModalComponent {
  map!: Map;
  marker!: Marker;
  latitude!: number;
  longitude!: number;

  constructor(private mapDialogRef: DynamicDialogRef) {}

  options = {
    layers: [
      tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        maxZoom: 18,
        attribution: '漏 OpenStreetMap contributors',
      }),
    ],
    zoom: 15,
    center: latLng(4.5709, -74.2973), // Coordenadas iniciales
  };

  onMapReady(map: Map) {
    this.map = map;

    this.map.on('click', (e: LeafletMouseEvent) => {
      const coords = e.latlng;
      this.placeMarker(coords);
    });
  }

  // eslint-disable-next-line no-undef
  placeMarker(coords: L.LatLng) {
    this.latitude = coords.lat;
    this.longitude = coords.lng;

    if (this.marker) {
      this.marker.setLatLng(coords);
    } else {
      this.marker = new Marker(coords, {
        icon: icon({
          iconSize: [40, 40],
          iconAnchor: [40, 40],
          iconUrl: '/assets/img/pinner.png',
          shadowUrl: 'assets/marker-shadow.png',
        }),
      }).addTo(this.map);
    }
  }

  selectMapLocation() {
    this.mapDialogRef.close({
      latitude: this.latitude,
      longitude: this.longitude,
    });
  }
}

import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { SupabaseService } from '@/app/core/services/supabase/supabase.service';
import { CompleteDataUserOAuthUseCaseService } from '@/app/domain/usecases/user/complete-data-user-oauth-use-case.service';
import { OAuthUserMetadata } from '@/app/core/models/auth';
import { fromEventPattern, take } from 'rxjs';
import { Session } from '@supabase/supabase-js';

@Component({
  selector: 'app-oauth-callback',
  standalone: true,
  imports: [],
  templateUrl: './oauth-callback.component.html',
  styleUrls: ['./oauth-callback.component.scss'],
})
export class OAuthCallbackComponent implements OnInit {
  constructor(
    private router: Router,
    private supabase: SupabaseService,
    private completeDataUserOAuthUseCase: CompleteDataUserOAuthUseCaseService
  ) {}

  ngOnInit() {
    fromEventPattern<[string, Session | null]>(handler => {
      const { data } = this.supabase.supabase.auth.onAuthStateChange(handler);
      return data.subscription?.unsubscribe.bind(data.subscription);
    })
      .pipe(take(1))
      // eslint-disable-next-line @typescript-eslint/no-misused-promises
      .subscribe(async ([, session]) => {
        if (session) {
          const user = session.user;
          const userMetadata = user.user_metadata as OAuthUserMetadata;

          await this.completeDataUserOAuthUseCase.execute({
            id: user.id,
            email: userMetadata.email,
            full_name: userMetadata.full_name,
          });

          await this.router.navigate(['']);
        } else {
          console.error('No session found, staying on callback page');
        }
      });
  }
}

